// react
import React, { Component } from 'react';

export class IndexSearch extends Component {
    render() {
        return (
            <div className="search-body">
                <div className="search_left-column">
                    Left banner
                </div>
                <div className="search_main">
                    Middle content
                </div>
                <div className="search_right-column">
                    Right banner
                </div>
            </div>
        );
    }
}
